import { TopBar } from "../components";
import { Outlet } from "react-router-dom";
import styled from "styled-components";

const StyledMainLayout = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  width: 100vw;
  height: 100vh;
`;

export const MainLayout: React.FC = () => {
  return (
    <StyledMainLayout>
      <TopBar />
      <Outlet />
    </StyledMainLayout>
  );
};
